INSERT INTO "students" VALUES(1,'Tillmän','Cordes','AD','raaawr.jpg','Während es in den USA eine lebendige Szene für vielseitig und aufwendig illustrierte Konzertposter gibt, muss man in Deutschland länger suchen, um ein Plakat zu finden, das mehr bietet als ein Bandfoto. Mit zwei exemplarischen Posterserien für zwei sehr unterschiedliche Festivals versuche ich meine eigenen Ideen zu diesem Medium umzusetzen und die Frage aufzuwerfen, warum das Illustrierte Poster hierzulande so unterrepräsentiert ist.','Konzertposter für Deutschland','tilmanncordes_01.jpg','tilmanncordes_02.jpg','tilmanncordes_03.jpg','null');
INSERT INTO "students" VALUES(2,'Nele','Gerull','AD','Gerull_Portrait.jpg','Reiselieber ermöglicht es, Gruppenreisen mit Leichtigkeit zu organisieren. Die digitale Plattform bringt Informationen, 
INSERT INTO "students" VALUES(3,'Dennis','Habieb','AD','Habieb_Porträt.jpg','Eine interaktive Kampagne für das Berliner Start-Up Culinary Misfits. Eine Plakatserie bewirbt die Aktion, bei der es darum geht, den schrägsten Typen Berlins zu finden. Die Teilnehmer bewerben sich auf der Facebook-Fanpage, auf welcher auch über den Gewinner abgestimmt wird. Darüber hinaus wird es einen Viralfilm geben, der alle Teilnehmer zeigt. Auf dem abschließenden Event werden verschiedene Preise an die fünf Gewinner verliehen. Begleitet wird die Kampagne von einer Guerilla-Aktion.','Wir suchen Berlins schrägsten Typen! ','Habieb_3.jpg','Habieb_2.jpg','Habieb_1.jpg','null');
INSERT INTO "students" VALUES(4,'Nicole','König','AD','NicoleNöding_foto.jpg','Text laesst sich nicht markieren in indesing!!!! Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus bibendum aliquam eros ut scelerisque. Etiam non tortor massa. Aliquam risus ligula, consequat et sodales id, adipiscing et felis. ','Website Relaunch','Nicole_nöding_3.jpg','Nicole_Noeding_2.jpg','NicoleNoeding_1.jpg','null');
INSERT INTO "students" VALUES(5,'Sarah','Pankratz','AD','sarahpankratz.jpg','Die Website www.alles-und-umsonst.de wurde im Jahr 2000 als private Initiative gegründet und dient konkurrenzlos als deutschlandweite Plattform, um Produkte zu verschenken, die man nicht mehr benötigt. Ein Redesign der Website sowie eine Werbekampagne sollen den Bekanntheitsgrad der Seite erhöhen. Junge Berliner Studenten mit wenig Budget sollen durch eine Party mit dem Motto „Alles umsonst“ als neue Zielgruppe gewonnen werden. ','Alles und Umsonst: Ein Zeichen setzen gegen die Wegwerfgesellschaft ','pankratz_1.jpg','pankratz_2.jpg','pankratz_3.jpg','pankratz_4.jpg');
INSERT INTO "students" VALUES(35,'Laura','Nebe','CICD','Portrait_Laura_Nebe_Absolventenkatalog.jpg','Bringdienste müssen vor allem eins sein, zuverlässig. Korrekte
INSERT INTO "students" VALUES(36,'Julia','Priede','CICD','Porträt_Priede.jpg','Im Zuge meiner Thesis habe ich mich mit einer fiktiven Neugestaltung des Corporate Designs der Eisdiele „Eiben Eis“ beschäftigt. Ein kleines sympathisches Geschäft, dass sein Eis noch nach Familienrezept selbst herstellt. Durch das Einsetzen von gemalten Bildern und Hintergründen wird das Handgemachte unterstrichen. Die klaren Farben und Formen lockern die Gestaltung letztendlich auf.','RELAUNCH DER EISDIELE "EIBEN EIS"','Priede_2.jpg','Priede_3.jpg','Priede_4.jpg','Priede_5.jpg');
INSERT INTO "students" VALUES(37,'Antonia','Schumacher','CICD','Porträt_schumacher.jpg','Bei Schalotte bekommst du das Gute von den Äckern der Umgebung. Ein fiktiver Lebensmittelmarkt, der seinen Fokus auf einen bewussten Umgang mit Ernährung legt. Schalotte ist nicht bio, sondern wertvoll. Neben dem Verkauf von Obst & Gemüse aus der Region wird ein Mittagstisch angeboten, der aus
INSERT INTO "students" VALUES(38,'Lutz','Forster','DM','Forster_Portrait.jpg','Wenn der Mensch dazu in der Lage wäre, durch technisch interaktiven Einfluss auf Milliarden von Gehirnzellen das Bewusstsein und die Gedanken zu formen und somit eine Nahtoderfahrung zu garantieren – was wäre dann?
INSERT INTO "students" VALUES(39,'Marcel','Kreipe','DM','Kreipe_Marcel_Portrait.jpg','Haben Sie sich auch schon mal gefragt, was in ihrem Haus passiert, wenn niemand daheim ist? Hier die Antwort! Inspiriert von Tschaikowskis Balletmusik und dem Kunstmärchen von E.T.A. Hoffmann ist, in akribischer Handarbeit, eine freie Interpretation des „Nussknackers“ enstanden. Ein spannender Kurzfilm, der Sie in eine fabelhafte Welt, voll lebendiger Räume und Gegenstände, entführt. Begleitet von einem Orchester, wird Ihnen dabei mehr als nur ein kurzer Blick durchs Schlüsselloch gewährt.','Die Quadratur des Kreises','Kreipe_Marcel_2.jpg','Kreipe_Marcel_3.jpg','null','null');
INSERT INTO "students" VALUES(40,'Christopher','David Lane','DM','christopher_david_lane_graustufe.jpg','Zooview ist eine interaktive Installation, welche über Zootiere und Aufgabenbereiche von modernen Zoologischen Gärten informiert. Die Geschichte eines Tieres wird exemplarisch mithilfe von Storytelling-Elementen stellvertretend für dessen gesamte Spezies erzählt. Die Benutzer bedienen ein Aussichtsfernrohr mit integrierten Bildschirm und steuern Wandgrafiken an, um mehr über die Tiere zu erfahren. Ausgestellt wird Zooview im öffentlichen Räumen, Museen und Zoologischen
INSERT INTO "students" VALUES(41,'Holger','Michel','DM','Passbild.jpg','Foto- und Filmbuch für Anfänger und Hobbyfotografen, die eine digitale Spiegelreflexkamera besitzen. Das Buch vermittelt die Grundlagen, die für ein gelungenes Bild notwendig sind. Ziel ist es, der fotografierenden Person ein Selbstvertrauen für die manuelle Nutzung einer Kamera zu geben.
INSERT INTO "students" VALUES(42,'Desiree','Peter','DM','Porträt_Desiree_Peter.jpg','Das Deutsche Erwachsenen-Bildungswerk (DEB) ist einer der großen Bildungsträger in Deutschland, der sich auf Ausbildungen, Studiengänge und berufliche Fort- und Weiterbildungen im Gesundheits- und Sozialbereich spezialisierte. Nach der Neugestaltung  von Web- und Printmedien fehlte dem Unternehmen noch ein Imagefilm. Diese Art von Film ist für die Außendarstellung des Unternehmens wichtig. Dabei erstreckt sich meine Arbeit vom Drehbuch bis zur Postproduktion eines ca. 5 Minuten langen Imagefilms.','Auf der Jagd nach dem Erfolg ','Drehfoto_1.jpg','Hauptdarsteller_2.jpg','C4Dlogo_3.jpg','null');
INSERT INTO "students" VALUES(43,'Nadine','Weiberg','DM','Weiberg_Portrait.jpg','Käferkunde ist eine App, mit der Käfer gelernt, nachgeschlagen, bestimmt oder gezeigt werden können. Allein in Deutschland gibt es ca. 6.500 verschiedene Käferarten. Während wir sie kaum beachten, müssen Förster sie kennen und lernen. 
